import React from 'react'
import { BrowserRouter as Router, Route, Link} from "react-router-dom";
import { Button, Icon, Input, Dropdown, Menu, Switch } from 'antd'
import { createSwitchNavigator } from "@react-navigation/core";
import { createBrowserApp } from "@react-navigation/web";
import { NavigationActions } from "@react-navigation/web";
import PostScreen from "./post"
import HomeScreen from "./articles"

const Navigator = createSwitchNavigator(
  {
    Home: { screen: HomeScreen },
    Post: { screen: PostScreen },
    // MainTabNavigator: { screen: MainTabNavigator },

  },
  {
    initialRouteName: 'Home',
  }
)

export default function({
  shuffle,
  search,
  setColumns,
  setMargin,
  setHeight,
  columns,
  margin
}) {
  return (
    <div className="header">

      <Button type="primary" onPress={() => this.props.navigation.dispatch(
  NavigationActions.navigate({ routeName: 'Post' })
)}>
        Add Article
      </Button>

      <div className="express-times"><h1>The Express Times</h1></div>

    </div>
  )
}
